import React from "react";
import "./Home.css";



export default function Home() {
  return (
    <div className="Home">
      <div className="lander">
      <div class="row">
         <div class="col-8 col-md-9" id="game">
            Level 2: .col-8 .col-sm-6
          </div>
          <div class="col-4 col-sm-6" id="chat">
           Level 2: .col-4 .col-sm-6
         </div>
     </div>
      </div>
      </div>
  );
}
